				"notes": [
					{
						"id": "6fb75b29-ae6b-4e6f-ba73-37a077fc397c",
						"note": "<h1>Food counterfeiting similar to drug counterfeiting</h1>\n<p>\"Counterfeited drugs are drugs that are not authentic and have been manufactured using incorrect quantities, or incorrect ingredients, to either reduce the potency, or nullify the potency of drugs altogether, and the same is applicable to food counterfeit.\"</p>\n<i>24</i>"
					},
					{
						"id": "749aae33-cbb7-4aac-9092-7b33e9736eec",
						"note": "<h1>Advantages of RFID</h1>\n<p>\"With RFID, drugs can be tracked at the item level throughout the supply chain. Individual packages are tagged at manufacturing and then read serially, in-bulk throughout the distribution chain. The read points include tag application, case packaging, total tracking throughout distribution and item level tracking and authentication at the pharmacy. With RFID, the entire drug supply chain becomes more efficient and secure.\"</p>\n<i>27</i>"
					},
					{
						"id": "f1774289-5526-4343-9b1b-1157c6654acb",
						"note": "<h1>Digital mass serialization in the supply chain</h1>\n<i>28</i>"
					}
				],
