				"notes": [
					{
						"id": "a3c8b5d4-6350-4814-899f-141f4fb089fa",
						"note": "<h1>Research not having any effect on food fraud incidents</h1>\n<p>“Our analysis of the literature indicates that within the areas of business risk and resilience, publications focus on aggregate event-driven cause and effect relationships. Events in the food supply chain over the past two years has evidenced a disconnect between outcomes of research and actual impact. Little is being done to limit the exposure to risk and provide support to the food businesses of Europe, of which a majority are food manufacturing companies....”</p>\n<i>660</i>"
					},
					{
						"id": "d7702e6d-03df-440c-99f4-23e4d5bbc2a7",
						"note": "<h1>Disconnect between academic and public interest in food fraud</h1>\n<i>662</i>"
					},
					{
						"id": "735834f8-6fae-4c73-8b55-00c3068752e6",
						"note": "<h1>Factors leading to food fraud in the supply chain</h1>\n<i>664</i>"
					},
					{
						"id": "9308f85e-7559-453b-a155-70db3f5521e2",
						"note": "<h1>Another problem of terminology: US uses \"food fraud\" and UK and Europe use \"food crime\" in the research</h1>\n<p>“Finally, there is a further challenge in this area with confusion over terminology - as highlighted by the Elliot report (Elliott, 2013) - where US led systems prefer the use of ‘fraud’ and European based research adopts ‘crime’, which creates another divergence of topics within the research. The divergence of terminology use is creating confusion in the system and the authors support the need for academia and practitioners to utilise the term ‘food crime’ in order to build and strengthen a coherent body of knowledge.”</p>\n<i>665</i>"
					}
				],
